/**
 * @internal
 * undo setup
 */
int
_mfd_qpid010SubscriptionTable_undo_setup(netsnmp_mib_handler *handler,
                                        netsnmp_handler_registration
                                        *reginfo,
                                        netsnmp_agent_request_info
                                        *agtreq_info,
                                        netsnmp_request_info *requests)
{
    int             rc;
    qpid010SubscriptionTable_rowreq_ctx *rowreq_ctx =
        (qpid010SubscriptionTable_rowreq_ctx *)
        netsnmp_container_table_row_extract(requests);

    DEBUGMSGTL(("internal:qpid010SubscriptionTable:_mfd_qpid010SubscriptionTable_undo_setup", "called\n"));

    netsnmp_assert(NULL != rowreq_ctx);

    /*
     * allocate undo context
     */
    rowreq_ctx->undo = qpid010SubscriptionTable_allocate_data();
    if (NULL == rowreq_ctx->undo) {
        /** msg already logged */
        netsnmp_request_set_error_all(requests,
                                      SNMP_ERR_RESOURCEUNAVAILABLE);
        return SNMP_ERR_NOERROR;
    }

    /*
     * row undo setup
     */
    rowreq_ctx->column_set_flags = 0;
    rc = qpid010SubscriptionTable_undo_setup(rowreq_ctx);
    if (MFD_SUCCESS != rc) {
        DEBUGMSGTL(("qpid010SubscriptionTable:mfd", "error %d from "
                    "qpid010SubscriptionTable_undo_setup\n", rc));
        netsnmp_request_set_error_all(requests, SNMP_VALIDATE_ERR(rc));
    } else {
        /*
         * column undo setup
         */
        netsnmp_table_request_info *tri;
        for (; requests; requests = requests->next) {
            /*
             * set column data
             */
            tri = netsnmp_extract_table_info(requests);
            if (NULL == tri)
                continue;

            rc = _qpid010SubscriptionTable_undo_setup_column(rowreq_ctx,
                                                            tri->colnum);
            if (MFD_SUCCESS != rc) {
                DEBUGMSGTL(("qpid010SubscriptionTable:mfd", "error %d from "
                            "qpid010SubscriptionTable_undo_setup_column\n",
                            rc));
                netsnmp_set_request_error(agtreq_info, requests,
                                          SNMP_VALIDATE_ERR(rc));
            }
        }                       /* for results */
    }

    return SNMP_ERR_NOERROR;
}                               /* _mfd_qpid010SubscriptionTable_undo_setup */

/**
 * @internal
 * undo setup
 */
int
_mfd_qpid010SubscriptionTable_undo_cleanup(netsnmp_mib_handler *handler,
                                          netsnmp_handler_registration
                                          *reginfo,
                                          netsnmp_agent_request_info
                                          *agtreq_info,
                                          netsnmp_request_info *requests)
{
    qpid010SubscriptionTable_rowreq_ctx *rowreq_ctx =
        (qpid010SubscriptionTable_rowreq_ctx *)
        netsnmp_container_table_row_extract(requests);
    int             rc;

    DEBUGMSGTL(("internal:qpid010SubscriptionTable:_mfd_qpid010SubscriptionTable_undo_cleanup", "called\n"));

    /*
     * failed row create in early stages has no rowreq_ctx
     */
    if (NULL == rowreq_ctx)
        return MFD_SUCCESS;

    /*
     * call user cleanup
     */
    rc = qpid010SubscriptionTable_undo_cleanup(rowreq_ctx);
    if (MFD_SUCCESS != rc) {
        /*
         * nothing we can do about it but log it
         */
        DEBUGMSGTL(("qpid010SubscriptionTable:mfd", "error %d from "
                    "qpid010SubscriptionTable_undo_cleanup\n", rc));
    }

    /*
     * release undo context, if needed
     */
    if (rowreq_ctx->undo) {
        qpid010SubscriptionTable_release_data(rowreq_ctx->undo);
        rowreq_ctx->undo = NULL;
    }


    return SNMP_ERR_NOERROR;
}                               /* _mfd_qpid010SubscriptionTable_undo_cleanup */

